import React from 'react';
import logo from './logo.svg';
import './App.css';

function NavBarIcon(props) {
    return (
        <div 
            className={props.active ? 'change': null} 
            onClick={props.onClick} >
            <div className="bar1"></div>
            <div className="bar2"></div>
            <div className="bar3"></div>
        </div>
    )
}

class NavBar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      active: false,
      navTabs: Array(2).fill(null),
    };
  }

  renderNavBarIcon() {
    return <NavBarIcon value={this.state.active} onClick={toggleClass}/>;
  }

  toggleClass() {
    const currentState = this.state.active;
    this.setState({ active: !currentState });
  };
}

function App() {
  return (
    <div className="App">
      <header className="header">
        <NavBarIcon/>
        <h1>Scheduler</h1>
      </header>
    </div>
  );
}

export default App;
